import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
    providedIn: 'root'
})
export class ProductsService {
    temp = {};
    constructor(private http: HttpClient) { }

    get() {
        this.http.get("http://localhost:3000/").subscribe(data => {
            this.temp = data;
            console.log(data)
        });
        return this.temp
    }
}
